import Layout from "../components/_App/Layout";
import React from "react";
import Store from "./../components/Store/Store";
import Validation from "./../components/Validation/Validation"

function App({ Component, pageProps }) {

  return (
    <Store>
      <Validation>
        <Layout> 
          <Component {...pageProps} />
        </Layout>
      </Validation>
    </Store>

  );

}

export default App;
